// import { useState, useEffect } from "react";
// import axios from "axios";
import "./reset.css";
import "./App.css";
import Logo from "./assets/images/logo.png";

const App = () => {
  // const [data, setData] = useState({});
  // const [isLoading, setIsLoading] = useState(true);

  // useEffect(() => {
  //   const fetchData = async () => {
  //     const response = await axios.get(
  //       "https://grubux-deliveroo-backend.herokuapp.com/"
  //     );
  //     setData(response.data);
  //     setIsLoading(false);
  //   };
  //   fetchData();
  // }, []);

  // console.log(data);

  return (
    <div>
      <div className="header ">
        <div className="wrapper">
          <img src={Logo} alt="Logo" className="logo" />
        </div>
      </div>

      <div className="wrapper">
        <div className="restaurant-info">
          <div>
            <p>Le Pain Quotidien - Montorgueil</p>
            <p>
              Profitez de chaque plaisir de la vie quotidienne. Le Pain
              Quotidien propose des ingrédients simples et sains, du bon pain,
              des fruits et des légumes frais et de saison issus de
              l’agriculture biologique.
            </p>
          </div>

          <img
            src="https://f.roocdn.com/images/menus/17697/header-image.jpg"
            alt="food"
          />
        </div>
      </div>

      <div className="grey-back">
        <div className="wrapper">
          <div className="restaurant-details">
            <div className="meals">
              <h3>Brunchs</h3>
              <div className="meal-container">
                <div>
                  <p>Brunch authentique 1 personne</p>
                  <p>Assiette de jambon cuit, jambon</p>
                  <div>
                    <p>25,00€</p>
                    <p>Populaire</p>
                  </div>
                </div>
                <img
                  src="https://f.roocdn.com/images/menu_items/1583350/item-image.jpg"
                  alt="brunch authentique"
                />
              </div>
            </div>
            <div className="basket">Le panier</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default App;
